import Header from './components/Header';
import Main from './components/Main/Main';
import Date from './components/Main/Date';
import './App.css';

function App() {
  const data = {
    tit: {
      welcome: "Welcome to component and props corner",
      title: "React",
      subtitle: "Javascript Library",
    },
    welcome: "Welcome to component and props corner",
    title: "React",
    subtitle: "Javascript Library",
    user: {
      firstname: "John",
      lastname: "Sedrick",
    },
    techskill: ["HTML", "JS", "CSS", "React"],
    date: new Date(),
  };
  return (
    <div className="App">
      <Header head = {data.tit}/>
      <Main body={data.user}/>
      <Date/>
    </div>
  );
}

export default App;
